            WriteLiteral(@"                    <span class=""recipe-nutrition-name"">Fibre</span>
                                        <span class=""recipe-nutrition-amount"">0g</span>
                                    </li>


                                </ul>

                            </div><!-- .recipe-nutrition -->





                            <div class=""recipe-content"">

                                <div class=""recipe-ingredients"">

                                    <h5>Ingredients</h5>

                                    <ul>

                                        <li class=""recipe-ingredient"" itemprop=""recipeIngredient"">
                                            8 lamb shanks
                                        </li>

                                        <li class=""recipe-ingredient"" itemprop=""recipeIngredient"">
                                            2 tbsp olive oil
                                        </li>

                                        <li class=""rec");
            WriteLiteral(@"ipe-ingredient"" itemprop=""recipeIngredient"">
                                            1 and a half onions, chopped
                                        </li>

                                        <li class=""recipe-ingredient"" itemprop=""recipeIngredient"">
                                            3 carrots, chopped
                                        </li>

                                        <li class=""recipe-ingredient"" itemprop=""recipeIngredient"">
                                            Few sprigs of rosemary (fresh)
                                        </li>

                                        <li class=""recipe-ingredient"" itemprop=""recipeIngredient"">
                                            2 bay leaves
                                        </li>

                                        <li class=""recipe-ingredient"" itemprop=""recipeIngredient"">
                                            5 garlic cloves, whole
                                        </");
            WriteLiteral(@"li>

                                        <li class=""recipe-ingredient"" itemprop=""recipeIngredient"">
                                            2 tbsp plain flour
                                        </li>

                                        <li class=""recipe-ingredient"" itemprop=""recipeIngredient"">
                                            3 tbsp tomato purée
                                        </li>

                                        <li class=""recipe-ingredient"" itemprop=""recipeIngredient"">
                                            300ml white wine
                                        </li>

                                        <li class=""recipe-ingredient"" itemprop=""recipeIngredient"">
                                            300ml lamb stock
                                        </li>
                                    </ul>

                                </div><!-- .recipe-ingredients -->

                                <div class=""recipe-meth");
            WriteLiteral(@"od"">

                                    <h5>Method</h5>
                                    <ol class=""method__list"">
                                        <li class=""method__item"">Heat oven to 200C/fan 180C/gas 6. Pour the olive oil in a casserole dish or roasting tray large enough to fit all the shanks and put it on the hob for 10 minutes to brown the lamb all over.</li>
                                        <li class=""method__item"">Remove the lamb from the dish or tray and place to one side. Add the onion and carrot and cook for 10 mins until starting to brown. Stir in the herbs and garlic and cook for a few more minutes. Stir in the flour and tomato purée, season well, then pour over the wine and stock.</li>
                                        <li class=""method__item"">Return the lamb shanks to the dish / tray. Bring to a simmer, cover with a lid or tightly with foil and then cook in the oven, undisturbed, for 1½-2 hrs until lamb is nice and tender.</li>
                                   ");
            WriteLiteral(@"     <li class=""method__item"">Remove the lamb from the sauce and set aside. Put pan back on the heat and bubble it down for about 15 mins until rich and glossy. Pass through a sieve into a jug. The lamb and sauce can be stored in the fridge for two days or frozen for one month. To serve, reheat the lamb in the sauce, adding a splash of water if the sauce is too thick.</li>
                                    </ol>
                                </div><!-- .recipe-method -->

